import React, { useCallback, useState } from "react";
import {useNavigate} from 'react-router-dom';

import './StartBtn.css';

const Button = () => {
    const history = useNavigate();

    const signUp = async event => {
      const [userId, setUserId] = useState(false);
        event.preventDefault();
        try {
            //const response = await fetch('http://localhost:5000/api/uploadFile/', {
            const response = await fetch('http://localhost:5000/api/users/signup', {
              method: 'POST',
              headers: {
                'Content-Type': 'application/json'
              },
              body: JSON.stringify({
                userId:"1"
              })
            });
            //const  responsedata = await response.json();
            const responsedata = await response.json();
            if (!response.ok) {
                throw new Error(responsedata.message);
              }
            //console.log(responsedata);
            history('/UploadPage')//navigate the user to the next page
          }catch(err){
            console.log(err);
            //setError(err.message  || 'Something went wrong');
          }
          const getUserId = useCallback((uid) =>{
            setUserId(uid);
          });
          const clearUserId = useCallback(() => {
            setUserId(null);
          });
        
    };

    return (
        <React.Fragment>
            <button onClick={signUp}  className="start-button">START</button>
        </React.Fragment>
    );
};

export default Button;
